function putFont(jspdf,fontname='default'){
 switch (fontname){
  case 'NotoSerif':
  default:
   var font = '';
   var ttf = 'NotoSerif-normal.ttf';
   var name = 'NotoSerif';
   var style = 'normal';
  break;
  case 'Oi':
   var font = '';
   var ttf = 'Oi-normal.ttf';
   var name = 'Oi';
   var style = 'normal';
 }
 jspdf.addFileToVFS(ttf,font);
 jspdf.addFont(ttf,name,style);

 console.log('Added font '+name+' to jsPDF object');
 return jspdf;
};
